    false,nt"url": null,nt"notes": "This map is from the 1954 Preliminary appraisal
    report for the Great Salt Marsh National Wildlife Refuge, known today as Quivira
    National Wildlife Refuge, in Stafford and Reno counties, Kansas.  This map shows
    ownership and cover type of the proposed refuge.  The original map was georeferenced
    against Stafford County NAIP (2012) imagery.  Fifteen points were used in the georeferencing
    process, and large landmarks such as intersections were used a reference points.
     It represents the refuge landuse and ownership 3 years prior to the establishment
    of Quivira National Wildlife Refuge.  This image allows a great look back in time
    to interpret habitat types and land use patterns.   Pixel resolution of this image
    is  3 meters. This image and map should be used for resource-level interpretation
    only.   This reference contains a PDF of the preliminary appraisal landuse map,
    and a georeferenced map.",nt"license_title": "License Not Specified",nt"extras":
